import { useState } from 'react';

const AchievementsList = () => {
  const [achievements] = useState([{title: 1}, {title: 2}, {title: 3}, {title: 4}]);
  return(
    <ul style={{listStyle: "none"}}>
      {achievements.map((item) => <li>{item.title}</li>)}
    </ul>
  )
}

export default AchievementsList;
